import React ,{Component} from 'react';
import {BrowserRouter,NavLink,Switch,Route} from 'react-router-dom';
import TestQues from './testQues'

class testKey extends Component {
    state={
        temp: "",
        key : "",
        flag : false
    }

    temp = (event) =>{
        this.setState({
            temp : event.target.value
        })
    }

    submit = () =>{
        this.setState({
            key : this.state.temp   
        }, () =>{
            console.log(this.state.key)
            if(this.state.key === "abc"){
                    this.setState(
                        {
                            flag : !this.state.flag
                        }
                    )
            }
        } )
        history.push()
    }    
    render() {
      return (
        <div>
            <input type="text" name="Key" onChange={this.temp} value={this.state.temp}/>  
            <BrowserRouter>
                <span>
                    <NavLink to="/new"><input type="button" value="Submit" onClick={this.submit}/></NavLink>                    
                </span>
            </BrowserRouter>
            {
                this.state.flag ? 
                    <Switch>
                        <Route exact path="/new" component={TestQues}/>
                    </Switch>
                    : null
            }
        </div>
      );
    }
  }

  export default testKey;
